// Define the custom element class for the live player
class LivePlayerJS extends HTMLElement {
    constructor() {
        super();
        // Initialize player state and properties
        this.player = null;
        this.volume = parseFloat(this.getAttribute('volume')) || 1;
    }

    connectedCallback() {
        // Create the video container
        const videoContainer = document.createElement('div');
        videoContainer.id = 'video-container';
        this.appendChild(videoContainer);

        // Initialize the player using LivePlayerJS library
        this.player = new Playerjs({
            id: 'video-container',
            file: this.getAttribute('file'),
            poster: this.getAttribute('poster'),
            volume: this.volume,
            countdowntext: this.getAttribute('countdowntext')
        });
    }

    // Define the observed attributes
    static get observedAttributes() { 
        return ['poster', 'file', 'countdowntext']; 
    }

    // Handle attribute changes
    attributeChangedCallback(name, oldValue, newValue) {
        if (this.player) {
            switch(name) {
                case 'poster':
                    // Update the poster attribute of the player
                    this.player.setPoster(newValue);
                    break;
                case 'file':
                    // Update the file attribute of the player
                    this.player.setFile(newValue);
                    break;
                case 'countdowntext':
                    // Update the countdowntext attribute of the player
                    this.player.setCountdownText(newValue);
                    break;
                default:
                    // Handle other attribute changes if needed
                    break;
            }
        }
    }
}

// Define the custom element for the live player
customElements.define('liveplayer-js', LivePlayerJS);